  "workflows.catalystDrepSignup.signWalletInfo": "\n1. Approuvez une action unique de signature pour vérifier la propriété de votre portefeuille.\n2. Cette action ne transfère pas de fonds, mais lie votre portefeuille à votre compte DRep.\n3. Suivez les instructions de votre portefeuille pour terminer la signature.",
