  "workflows.catalystDrepSignup.successInfo": "\n1. En cas de succès, un message de confirmation s’affichera et votre compte DRep sera actif.\n2. En cas d’erreur, vérifiez :\n* Une mauvaise connexion du portefeuille\n* Des retards ou erreurs réseau\n3. Réessayez ou contactez le support en cas de problème persistant.",
  "workflows.catalystDrepSignup.platformStatement": "Déclaration de Plateforme",
